class UpdateStockDansaiController extends Controller

{
    public function actionIndex()
    {

        // $this->clear();
        $stockList = $this->listItem();
        foreach ($stockList as $stock) {
          
            $warehouseId = str_replace(',', '', $stock[1]);
            $assetItem = str_replace(',', '', $stock[2]);
            $type = str_replace(',', '', $stock[4]);
            $code = str_replace(',', '', $stock[5]);
            $categoryId  = $this->getCategoryId($code);
            $qty = str_replace(',', '', $stock[6]);
            $unit_price = str_replace(',', '', $stock[7]);
            //   if($warehouseId!=='' && $type =='วัสดุสำนักงาน' &&  $warehouseId ==7){
              if($warehouseId!==''){
                 $orderItem = new StockEvent;
                 $orderItem->name = 'order_item';
                 $orderItem->order_status = 'pending';
                 $orderItem->code = $code;
                 $orderItem->warehouse_id = $warehouseId;
                 $orderItem->asset_item = $assetItem;
                 $orderItem->category_id = $categoryId;
                 $orderItem->qty = $qty;
                 $orderItem->unit_price = $unit_price;
                 $orderItem->data_json = [
                        "req_qty" => "0",
                        "exp_date" => "",
                        "mfg_date" => "",
                        "item_type" => "ยอดยกมา",
                        "po_number" => "",
                        "pq_number" => "",
                        "asset_type" => "",
                        "receive_date" => "",
                        "asset_type_name" => "",
                        "employee_fullname" => "",
                        "employee_position" => "",
                        "employee_department" => ""
                 ];
                 $orderItem->save(false);
            }
        }

       
    }

    public function getCategoryId($code)
    {
        $model = StockEvent::findOne(['name' => 'order','code' => $code]);
        if($model){
            return $model->id;
        }else{
            return 0;
        }
    }

    public function actionClear()
    {
        $codes = [
            'IN-680001','IN-680004','IN-680005','IN-680006','IN-680008','IN-680009','IN-680010','IN-680003','IN-680011',
            'IN-680012','IN-680013','IN-680014','IN-680015','IN-680016','IN-680017','IN-680018'
        ];
        $all = StockEvent::find()->where(['name' =>'order'])->andWhere(['IN','code',$codes])->all();
        foreach($all as $allItem){
            // echo $allItem->id." Name = ".$allItem->name." | code = ".$allItem->code."\n";
            $item = StockEvent::deleteAll(['name' => 'order_item','category_id' => $allItem->id]);
            if($item){
                // $item->delete();
                echo 'ลบข้อมูลสำเร็จ'."\n";
            }

        }

        // $model = StockEvent::deleteAll([
        //     'and',
        //     ['name' => 'order_item'],
        //     ['code' => $codes]
        // ]);
        // echo "Stock events cleared.".$model."\n";
    }
